import React from "react";

const Location = ({ className }) => {
  return (
    <svg
      width='15'
      height='23'
      viewBox='0 0 15 23'
      fill='none'
      xmlns='http://www.w3.org/2000/svg'
      className={className}
    >
      <path
        d='M13.4999 10.7501C11.2499 16.0001 7.49994 22.0001 7.49994 22.0001C7.49994 22.0001 3.74994 16.0001 1.49994 10.7501C-0.750061 5.50009 2.99994 1.00009 7.49994 1.00009C11.9999 1.00009 15.7499 5.50009 13.4999 10.7501Z'
        stroke='#F56E1E'
        strokeWidth='1.5'
        strokeLinecap='round'
        strokeLinejoin='round'
      />
    </svg>
  );
};

export default Location;
